class Edge {
    
    constructor(node1: string, node2: string) {
        this._nodes = [node1, node2];
        this._nodes.sort();
    }
    
    private _nodes: [string, string];
    
    get nodes() {
        return new Set(this._nodes);
    }
    
    public key(): Symbol {
        return Symbol.for(JSON.stringify(this._nodes));
    }
}

